            "text" : "Bryan Napolitano as well. The place is wall to wall ex Lehman people (especially those who did a “follow the leader” to Bank of America). I’ve met up with Bryan a couple of times and I vaguely remember running into Marc once. All that said, you did the right thing by striking out on your own (sort of). Although it may seem more stable in a big corporation, there’s regular lay offs and stress and you don’t have much choice over what you build or how. (I hope you weren’t thinking about it...)",
