            "recipientId" : "10786622",
            "reactions" : [ ],
            "urls" : [ ],
            "text" : "I can’t remember if I told you but I moved to JPMC last May. About 6 weeks ago there was an opportunity to take sort of voluntary redundancy — Wednesday was my last day in the office so I’m currently at my mother’s house in the UK (watching it snow) and looking forward to at least 2 months’ off. I don’t think I could ever do what you did. I would be happy enough working on my own hacking away at something, but I wouldn’t want to have to be selling the product, and I definitely wouldn’t want to be responsible for people’s salaries. Good on you for trying it.",
