            "text" : "Oh so jobby job. I start the first week of Jan and I’ll be the CTO of a startup called Kidfund. we’re creating an app/platform to help you save money for your child’s education. Have finished friend and family round of funding to pay an agency to design and build the beta and get us through next year.",
