            "urls" : [ ],
            "text" : "whew that’s better.\n\nSo, realm wouldn’t handle talking to your API. Whatever you currently do would keep doing that. What realm will help with is persisting that and then telling your UI what to update and how\n\n(sorry had started typing that when ur message came in. reading)",
