            "text" : "Hi!\nIf you are not a PHP developer, please ignore this DM.\n\nIf you are a PHP developer, I'm writing you to ask your help in promoting my next Day Camp 4 Developers: PHPAppSec.\n\nhttps://t.co/6yzamxGJ1J\n\nSecurity is important to every developer and I've brought together 5 great speakers covering 5 great topics all designed to help PHP developers write more secure apps.\n\nI'm not asking you to buy a ticket - I mean I'd love it if you did - I'm just asking that you spare 1 tweet to your followers letting them know about this on-line conference happening June 2nd.\n\nSomething like this would work.\n---\nIf your PHP Application's Security is important to you and your team, check out DC4D: PHPAppSec.\n\nhttps://t.co/6yzamxGJ1J\n\n#DC4D #PHP\n---\n\nTIA for your help.\n=C=\n\np.s. What can I do to help YOU?",
