            "urls" : [ ],
            "text" : "* love the overlay when logging into amazon and when I use an Insta screenshot. Is that custom or a pod?\n* If I was already logged into amazon on safari should I have already been logged in?\n* went to import from amazon again and was logged out\n* swipe to delete on buy list is super slick\n* I'd think that if I hit + on the buy list, browsing and choosing from collections, or searching from everything, would be available from that action\n* Feature Request: Bi-directional sync with Amazon wish lists. I use them pretty heavily either for gifts for myself or my kids. Being able to import into here would be cool but more importantly, being able to populate Amazon wish lists from here would be a killer feature for me. We share the lists among our extended family for holiday/bday shopping. \n* Alternatively being able to share a collection or buy list. Or collaborate on a collection! My wife and I have a few shared wishlists to organize house stuff that we save up for. \"needed, immediate\", \"important\", \"nice to have\", etc",
